INSERT INTO `circles` VALUES (1,'テニーズ',126,'楽しいテニスサークルです',27,'1','鶴舞公園テニスコート',2,'毎週水曜日','なし','OjsgvLxU77J5SvlkVdYzF6Tpn2AIKXV2XHuMprXK.jpeg',0,NULL,0,0,NULL,'2020-05-27 06:11:54'),(2,'リトルチキン',126,'飲み会多めのサークルですが、練習もしっかりやります。未経験者歓迎です。',27,'1','大学内グラウンド',2,'毎週金曜日','なし','kUCvOqEsr4G8CqSjLcoY4p9Tr4LkRi1CYLCNOhxc.jpeg',0,NULL,0,0,NULL,'2020-06-03 08:47:41'),(3,'アイドル研究会',126,'メジャーなアイドルも地下アイドルもアイドル付きは誰でも歓迎です。学祭では有志でライブを行います。ぜひ足を運んでください。',27,'1','G棟２階教室',2,'毎週火曜日','なし','X9HPBKdhUiZZ9iBPa7WK461yNW6HPsciHV4ZesMB.jpeg',0,NULL,1,0,NULL,'2020-06-03 08:43:17'),(4,'どさんこ',126,'北海道のグルメを食べ歩きします。',1,'6','北海道大学',2,'毎週火曜日','月５０００円','jheUdzo6jMlBpZ4XdcAB5IeF2M4hgn2oeFZIF8cE.jpeg',0,NULL,1,0,NULL,'2020-05-29 09:46:49'),(5,'テニス愛好会',126,'楽しいテニスサークルです。飲み会はありません。',1,'2','札幌テニスコート',2,'毎週水曜日','なし','5COymIoSKe7vg7m3DMH550nmMTU67oGtnSYINXz3.jpeg',0,NULL,0,0,NULL,'2020-05-29 09:45:53'),(6,'バブーン',126,'フットサルサークルです。美男美女しかいません。',1,'1','グラウンド',2,'毎週金曜日','なし','H8MJqfCeO9rw1GgWTjnrml0y9UYZUGdMcRCOkrr2.jpeg',0,NULL,0,0,NULL,'2020-05-29 09:43:04'),(7,'グルメハンター',126,'食べ歩き・料理など食をテーマにか幅広く活動しています。',1,'1','商店街',2,'毎週火曜日','なし','xJPLYMTqVGnO761vyZpvVI4kM2L11Tq2qS4qSlgD.jpeg',0,NULL,0,0,NULL,'2020-05-29 09:38:48'),(8,'dancedance',126,'ガチ勢ばかりのダンスサークルです。本気の方だけ来てください。',1,'2','スポーツセンター',2,'毎週火曜日','月１０００円','HZWWONa2vqAuf4815S9zhtHOdVlsjahOR5bfhEyJ.jpeg',0,NULL,0,0,NULL,'2020-05-29 09:36:20'),(10,'tennys',126,'和気藹々と活動しています。',23,'1','鶴舞公園',1,'毎週水曜14:30','年会費8000円','MueYTOPmkes6inohioYRdYOZplrLSn6se3bnzxlu.jpeg',0,'学年\r\n\r\nテニス歴\r\n\r\n趣味',0,0,'2020-05-14 21:01:05','2020-05-27 06:13:05'),(26,'お楽しみ会',126,'週に何度か集まり、お茶会・パーティー・飲み会などをひらき親交を深めています。ぜひ気軽にご参加ください。',23,'1','参加者のみ別途連絡',2,'平日夜もしくは休日','平均3000円','iqWzn1ZAufHiYXF77RInBXkCqk25ly8BNbgCXhXq.jpeg',0,'名前・年齢・趣味・ニックネーム',1,0,'2020-05-14 23:49:53','2020-05-27 06:12:53'),(35,'英会話サークル　Eクラ',126,'平日夜に集まります。使っていいのは英語のみです。留学生や講師を招いて本格的な英語を身につけます。\r\n初心者〜上級者まで参加歓迎です。',13,'3',NULL,2,'平日１９時から','1000円ほど','qqbawZXTquhWFmxK4lS2RaBcBwHm86DH3cHMMLpC.jpeg',0,'名前・年齢・性別・英会話レベル',1,0,'2020-05-16 20:29:56','2020-05-27 06:14:06'),(36,'ピーカブー',125,'ダイビングサークルです。\r\n未経験者大歓迎です！\r\n半年でライセンスの取得を目指します。\r\n毎週飲み会をします。お酒の好きな方やダイビングに興味のある方はぜひ参加してみてください。学部の先輩からいろいろアドバイスがもらえるかも！',13,'2',NULL,2,'毎月第3土曜日','5000円くらい','FYrCJsA0lRfjFTUMowgidHRiYkfQuxwlR49law1G.jpeg',0,'名前・年齢・経験の有無',0,0,'2020-05-16 21:06:37','2020-05-27 06:14:49'),(40,'アニメ好き集まれ！',128,'アニメ好き同士で思う存分楽しく語り合います。',23,'1','なし',2,'休日昼','なし','J1bRPOco26JyEhH8J8idhjAj0xZbqmQNSyfzs32I.jpeg',0,'名前・好きなアニメなど',1,0,'2020-05-17 21:29:36','2020-05-27 06:09:36'),(44,'ママ友作',126,'子育て中の奥様同士親交を深めましょう。',1,'1',NULL,3,'平日昼間','3000円','Vkq8ysyerQcnY3bASJF8mIiyW5cBSOv5FwLNclRV.jpeg',1,'名前・年齢・お子様の年齢',1,0,'2020-05-20 10:27:43','2020-05-27 06:03:33'),(72,'古典部',126,'小説を書きます。',1,'7',NULL,0,NULL,NULL,'X7bCycwPOBgo2V1GcRPSeERBKivonOkFCxSymEGz.jpeg',0,NULL,0,0,'2020-05-26 10:37:30','2020-05-27 06:03:06'),(73,'Let\'s Euglish',136,'英会話サークルです。英語を話せるようになりたい方ならば大歓迎です。',23,'3',NULL,2,'毎週水曜19時〜',NULL,'gSKLTfSVE3AIde52tIu7tRNF6twDwYUicApH3P2t.jpeg',0,'名前・年齢・英語レベル',0,0,'2020-06-03 09:54:14','2020-06-03 09:54:14'),(85,'スクリーン',126,'週一度バスケをします。初心者も大歓迎。',23,'2',NULL,NULL,NULL,NULL,'OWJQsj8YE6H736ghIM0Den4ztiG8dktvQgNI7Slk.jpeg',0,'名前・バスケ歴など',0,0,'2020-06-05 12:35:26','2020-06-05 12:35:26'),(86,'飲み会サークル 「のみとも‼︎」',126,'毎週金曜日に20代を中心に飲み会を開催しています。誰でも参加できます。最近ではzoom飲みも行っておりますので気軽に参加してください‼︎',13,'1',NULL,NULL,NULL,NULL,'0pfhq1zfcfoI7mfdkufeegU6v5FRuSK0IhDH7X0w.jpeg',0,NULL,0,0,'2020-06-14 13:12:11','2020-06-28 10:19:30'),(87,'b',126,'b',2,'1',NULL,NULL,NULL,NULL,'RjuTe0PNknfLQwMzLJBR7zqqAUS3AVDzzhsuDFja.jpeg',NULL,NULL,NULL,NULL,'2020-06-14 13:22:36','2020-06-14 13:22:36'),(91,'c',126,'c',2,'1',NULL,NULL,NULL,NULL,'323fvxtJddc2Nct8niSSE1Z0ErhKTWMt8AI7zVKz.jpeg',NULL,NULL,NULL,NULL,'2020-06-14 13:58:58','2020-06-14 13:58:58'),(92,'エンジニア同志繋がろう！',126,'東京を中心にプログラミングの勉強会を行います。様々な分野のエンジニアと繋がろう。',13,'3',NULL,NULL,NULL,NULL,'ZifaE3E70CwaQtSfTfN0paTpUuB8MAGXSOxLhVxU.jpeg',NULL,NULL,NULL,NULL,'2020-06-26 13:35:17','2020-06-26 13:58:55');
